import React from 'react'
import "./learn.css"

const Learn = () => {
  return (
    <div className='navbar'>
        <div className='navbar-container'>
            <div className='logo' onClick={toggleMenu}>
                <p>List<span>Race</span></p>
            </div>
            {menuOpen }
        </div>
    </div>
  )
}

export default Learn
